import "./ToGoMenuPage.css";
import Drinks from "../Drinks/Drinks";

function ToGoMenuPage() {
    return(
      <div className="drinks-to-go-container">
        <h2 className="to-go-title">To go</h2>
        { DrinksToGoList() }
      </div>
    )
}

let drinks = [
    {
      name: "Limonada to go",
      price: "90.00",
    },
    {
      name: "Espresso to go",
      price: "70.00",
    },
    {
      name: "Makiato to go",
      price: "80.00",
    },
    {
      name: "Latte to go",
      price: "80.00",
    },
    {
      name: "Nescafe to go",
      price: "80.00",
    },
    {
      name: "Coffee + lemonada",
      price: "150.00"
    },
    {
      name: "Hot choco to go",
      price: "80.00",
    },
    {
      name: "Americano to go",
      price: "70.00",
    },
    {
      name: "Turkish to go",
      price: "50.00",
    },
    {
      name: "Capucino to go",
      price: "80.00",
    },
]

function DrinksToGoList() {
    let lists = [];

    for (let i = 0; i < drinks.length; i++) {
      let list = (
        <Drinks drink={drinks[i]} />
      );
      lists.push(list);
    }

    return lists;
  }


export default ToGoMenuPage;
